 der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",_wc='Dimension',Uic='Dimension [height=',ptc='DirectionalTextHelper',stc='DockLayoutPanel',ttc='DockLayoutPanel$Direction',utc='DockLayoutPanel$Direction;',xtc='DockLayoutPanel$DockAnimateCommand',vtc='DockLayoutPanel$LayoutData',zpc='DomEvent',Epc='DomEvent$Type',Jvc='Double',Vfc='EAST',Rac='EEE, d MMM yyyy HH:mm:ss Z',Jlc='EEE. dd MMM. yyyy HH:mm:ss',jbc='EEEE, MMMM d',Uac='EEEE, MMMM d, y',s8b='EM',Zdc='EMPTY',cec='ENABLED',wcc='END',u8b='EX',Vrc='ElementMapperImpl',Wrc='ElementMapperImpl$FreeNode',lcc='English',Loc='Enum',ccc='Etc/GMT',ecc='Etc/GMT+',dcc='Etc/GMT-',N8b='Event type',Puc='Event$NativePreviewEvent',Rpc='EventBus',Ync='EventObject',boc='Exception',Aec='Expecting version 6 from server, got ',I9b='F',Sjc='F8834F07517EF3B7D02B9E845E5E1B88',n8b='FIXED',Yec='FLOAT',Ajc='Fail: ',aac='Feb',Q9b='February',Kvc='Float',ytc='FlowPanel',Osc='FocusImpl',Qsc='FocusImplSafari',Psc='FocusImplStandard',Zsc='FocusWidget',Whc='For input string: "',Eac='Fri',xac='Friday',_8b='GET',$lc='GGD55X
